export const loginUser = (userData) => {
    return {
        type: 'LOGIN_SUCCESS',
        payload: userData,  // The user data from the login response
    };
};

export const RegisterUser = (userData) => {
    return {
        type: 'Register_SUCCESS',
        payload: userData,  // The user data from the login response
    };
};
